import './App.css';
import { BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import Login from './pages/Login';
import Register from './pages/Register';

function App() {
  return (
    <Router>
      <div className="App">
        <Link to="/Login">Home</Link>
        <Switch>
            <Route exact path="/pages/Login/index.jsx" data={Login}/>
            <Route exact path="/Register" data={Register}/>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
